// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;

contract BasicTest {
    enum DooblonCoin {
        Silver,
        Copper
    }

    enum OfferStatus {
        Pending,
        Placed,
        Rejected,
        Accepted
    }

    struct Customer {
        uint id;
        string customerName;
        string[] markets;
        bool created;
        mapping(DooblonCoin => uint) wallet;
    }

    struct Offer {
        uint id;
        uint customerID;
        DooblonCoin giveCoin;
        DooblonCoin takeCoin;
        uint quantity; /// Quantity of given coin
        uint quantityExpected;
        OfferStatus status;
    }

    struct Trade {
        uint id;
        Offer offer1;
        Offer offer2;
    }

    struct StockMarket {
        string name;
        uint[] customers;
        uint[] offersPlaced;
        uint[] tradesInitiated;
        mapping(uint => bool) listedTrades;
        bool created;
    }

    uint constant silverPrice = 1;
    uint constant copperPrice = 100;

    mapping(DooblonCoin => uint) priceList;

    string[3] marketNames = ["AbobaMarket", "PepeStocks", "Deez Nutz Inc."];

    mapping(string => StockMarket) marketList;
    mapping(uint => Customer) customerList;
    mapping(uint => Offer) offers;
    mapping(uint => Trade) trades;

    event StockMarketCreated(string name);
    event CustomerJoinedStockMarket(string name, uint id);

    event TradeInitiated(string, uint tradeID);
    event NoMatchingOffer(string);

    event OfferPlaced(
        uint customerID,
        DooblonCoin givenCoin,
        DooblonCoin takeCoin,
        uint quantityGiven,
        uint quantityExpected,
        uint offerID
    );

    event CustomerCreated(string name, uint id);
    event CustomerFunded(DooblonCoin coin, uint quantity);

    modifier customerIDCheck(uint customerID) {
        require(
            checkCustomerExists(customerID),
            "ID not matching any customer"
        );
        _;
    }

    constructor() {
        /// Creates 3 markets - names are listed in 'marketNames'
        for (uint i = 0; i < marketNames.length; i++) {
            createStockMarket(marketNames[i]);
        }
        priceList[DooblonCoin.Silver] = silverPrice;
        priceList[DooblonCoin.Copper] = copperPrice;
    }

    function randomNum() public view returns (uint) {
        uint num = block.timestamp;
        uint blockNum = (block.number);
        uint result = (num * blockNum) % 10000;
        return result;
    }

    function createCustomer(string memory name) external {
        uint id = randomNum();
        Customer storage customer = customerList[id];
        customer.customerName = name;
        customer.id = id;
        customer.created = true;
        emit CustomerCreated(name, id);
    }

    function createStockMarket(string memory name) private {
        /// Creates StockMarket object
        StockMarket storage market = marketList[name];
        market.name = name;
        market.created = true;
        emit StockMarketCreated(name);
    }

    function checkCustomerExists(uint id) public view returns (bool) {
        if (customerList[id].created) {
            return true;
        } else {
            return false;
        }
    }

    function checkStockMarketExists(
        string memory name
    ) public view returns (string memory) {
        /// Check if stock market with given name exists
        if (marketList[name].created) {
            return "Market exists!";
        } else {
            return "No such market!";
        }
    }

    function fundCustomerWallet(
        uint customerID,
        DooblonCoin coin,
        uint quantity
    ) external customerIDCheck(customerID) {
        Customer storage customer = customerList[customerID];
        customer.wallet[coin] += quantity;
        emit CustomerFunded(coin, quantity);
    }

    function customerJoinStockMarket(
        string memory marketName,
        uint customerID
    ) public customerIDCheck(customerID) {
        Customer storage customer = customerList[customerID];
        StockMarket storage stockMarket = marketList[marketName];
        stockMarket.customers.push(customerID);
        customer.markets.push(stockMarket.name);
    }

    function placeOffer(
        string memory stockMarketName,
        uint customerID,
        DooblonCoin giveCoin,
        DooblonCoin takeCoin,
        uint quantity
    ) public customerIDCheck(customerID) {
        StockMarket storage stockMarket = marketList[stockMarketName];
        Customer storage customer = customerList[customerID];
        require(customer.wallet[giveCoin] >= quantity, "Insufficient balance");
        uint offerID = randomNum() * 10;
        uint quantityExpected;
        stockMarket.offersPlaced.push(offerID);

        /// Offer object setting
        Offer storage offer = offers[offerID];
        offer.status = OfferStatus.Pending;
        offer.id = offerID;
        offer.customerID = customerID;
        offer.giveCoin = giveCoin;
        offer.takeCoin = takeCoin;
        offer.quantity = quantity;

        /// Customer wallet setting
        if (giveCoin == DooblonCoin.Silver) {
            quantityExpected = quantity * copperPrice;
            offer.quantityExpected = quantityExpected;
        } else if (giveCoin == DooblonCoin.Copper) {
            quantityExpected = quantity / copperPrice;
            offer.quantityExpected = quantityExpected;
        }
        customer.wallet[giveCoin] -= quantity;
        offer.status = OfferStatus.Placed;
        emit OfferPlaced(
            customerID,
            giveCoin,
            takeCoin,
            quantity,
            quantityExpected,
            offerID
        );
    }

    function initiateTrade(string memory stockMarketName, uint offerID) public {
        StockMarket storage stockMarket = marketList[stockMarketName];
        Offer storage offer = offers[offerID];
        uint len;
        uint tempID;
        bool initiated;

        uint tradeID;

        len = stockMarket.offersPlaced.length;
        for (uint i = 0; i < len; i++) {
            tempID = stockMarket.offersPlaced[i];
            Offer memory tempOffer = offers[tempID];
            require(tempOffer.status == OfferStatus.Placed);
            require(offer.status == OfferStatus.Placed);
            if (
                offer.giveCoin == tempOffer.takeCoin &&
                offer.quantity == tempOffer.quantityExpected
            ) {
                tradeID = randomNum() * 11;
                Trade storage trade = trades[tradeID];
                trade.id = tradeID;
                trade.offer1 = offers[offerID];
                trade.offer2 = offers[tempID];

                uint customerID_1 = offer.customerID;
                uint customerID_2 = tempOffer.customerID;

                Customer storage customer_1 = customerList[customerID_1];
                Customer storage customer_2 = customerList[customerID_2];

                customer_1.wallet[offer.takeCoin] += offer.quantityExpected;
                customer_2.wallet[tempOffer.takeCoin] += tempOffer
                    .quantityExpected;

                stockMarket.tradesInitiated.push(tradeID);
                stockMarket.listedTrades[tradeID] = true;

                offer.status = OfferStatus.Accepted;
                tempOffer.status = OfferStatus.Accepted;

                emit TradeInitiated("Trade succesfully initiated", tradeID);
                initiated = true;
                break;
            }
        }
        if (initiated == false) {
            emit NoMatchingOffer("No offers to initiate trade");
        }
    }

    function getTradeInfo(
        string memory marketName,
        uint tradeID
    )
        public
        view
        returns (
            string memory,
            DooblonCoin,
            uint,
            string memory,
            DooblonCoin,
            uint
        )
    {
        StockMarket storage market = marketList[marketName];
        require(
            market.listedTrades[tradeID] == true,
            "No such trade on that market"
        );
        Trade storage trade = trades[tradeID];

        Offer storage offer1 = trade.offer1;
        Offer storage offer2 = trade.offer2;

        DooblonCoin takeCoin1 = offer1.takeCoin;
        DooblonCoin takeCoin2 = offer2.takeCoin;

        uint quantityExpected1 = offer1.quantityExpected;
        uint quantityExpected2 = offer2.quantityExpected;

        return (
            "Offer_1 got:",
            takeCoin1,
            quantityExpected1,
            "Offer_2 got:",
            takeCoin2,
            quantityExpected2
        );
    }

    function getCustomerInfo(
        uint customerID
    ) internal view customerIDCheck(customerID) returns (Customer storage) {
        Customer storage customer = customerList[customerID];
        return customer;
    }

    function showWallet(
        uint customerID,
        DooblonCoin coin
    ) public view customerIDCheck(customerID) returns (uint) {
        uint bal = getCustomerInfo(customerID).wallet[coin];
        return bal;
    }

